import React from "react";

function ExpenseTable({ expenses }) {
    return (
        <table>
            <tr>
                <th>Name</th>
                <th>Cost</th>
                <th>Category</th>
            </tr>
            {
                expenses.map(
                    (e, i) => <tr key={i}>
                        <td>{e.name}</td>
                        <td>{e.cost}</td>
                        <td>{e.category}</td>
                    </tr>
                )
            }
        </table>
    )
}

export default ExpenseTable;
